import  { MdClose } from "react-icons/md";
 import "./Search.scss";
const Search = ({setShowSearch}) => {
    return (
    <div className="search-modal">
        <div className="form-field">
            <input
             type= "text" 
             autoFocus
             placeholder="Search for  products"

            />
            <MdClose onClick={() => setShowSearch(false)} />
        </div>

    </div>
    );
}; 

export default Search;
